import "./Header.scss";

function Header() {
  return (
    <header className="header">
        <img src="#" className="header-logo"></img>

        <div className="header-navegation">
            <li className="header-navegation_menu"><a href="#events">Ropa</a></li>
            <li className="header-navegation_menu"><a href="#events">merchandising</a></li>
            <li className="header-navegation_menu"><a href="#events">Ordenadores</a></li>
        </div>

        <form action="#" className="header-search">
            <input type="text" className="header-search__input"></input>
            <button className="header-search__button">
                <svg className="header-search__icon">
                    <use xlinkHref='./../img/sprite.svg#icon-magnifying-glass'></use>
                </svg>
            </button>
        </form>

    </header>
  );
}

export default Header;
